$(".analysis_name").click(function () {
  if (isUpload) {
    var uploadFiles = document.querySelectorAll(".fileUpload")[0];
    var file = uploadFiles.files[0]; //文件

    if (file) {
      var size = file.size / 1024 / 1024;
      if (size < 10) {
        $("#marklayer").addClass("mark-show"); //加载状态

        var formData = new FormData();
        formData.append("image", file);

        $.ajax({
          method: "POST",
          headers: {
            "secret-id": secret_id,
            "secret-key": secret_key,
          },
          url: baseAPI + "/faceCheck",
          data: formData,
          contentType: false,
          processData: false,
          success: function (res) {
            $("#marklayer").removeClass("mark-show");
            if (res.code == 200) {
              $(".tips").css("display", "none");
              $("#analysis_results").css("display", "block");
              let resJSON = JSON.stringify(res);
              resObj = JSON.parse(resJSON);
              let returnresult = syntaxHighlight(resObj);
              $("#analysis_results img").attr("src", res.result.image);
              $("#returnresult").html(returnresult);
            }
          },
        });
      }
    }
  } else {
    $("#marklayer").addClass("mark-show"); //加载状态
    setTimeout(() => {
      $("#marklayer").removeClass("mark-show");
      $(".tips").css("display", "none");
      $("#analysis_results").css("display", "block");
      $("#analysis_results img").attr(
        "src",
        detectResult[current].result.image
      );
      $("#returnresult").html(syntaxHighlight(detectResult[current]));
    }, 2000);
  }
});
